function submit(n){if(n.preventDefault(),$("#AddProduct").valid()){let n=$("#LoadingSpinner");$("#AddProduct input[type='submit']").prop("disabled",!0).addClass("d-none");n.removeClass("d-none");fetch(apiUrls.adminAddProduct,{method:"POST",body:new FormData(form)}).then(n=>n.json()).then(t=>{n.addClass("d-none"),$("#ProductAdded").removeClass("d-none"),$("html, body").animate({scrollTop:0},"fast"),window.setTimeout(()=>{window.location.href=t.redirectUrl},3e3)})}}const form=document.getElementById("AddProduct");$(document).ready(()=>{$("#AddProduct").on("submit",submit)});